    --(3) Add Order to Missed Rout-Ops
	SELECT	A.[Production order ID],A.[Route number], RTRIM(A.[Route number]) + '-' + CAST(CAST(B.[Last Operation] AS INT) AS NVARCHAR(10)) RutaOP
	FROM	[dbo].['Production  details$']	A INNER JOIN 
			[dbo].['Last Operation$']		B on A.[Production order ID] = B.[Production order ID]
	WHERE [Last Operation] <> ''	
		  and RTRIM(A.[Route number]) + '-' + CAST(CAST(B.[Last Operation] AS INT) AS NVARCHAR(10)) 
		  IN ('ROU00029518-220')
